
let h1Element = document.createElement("h1");
h1Element.setAttribute("id","title");
let pElement = document.createElement("p");
pElement.setAttribute("id","description");
h1Element.textContent = "Simple Calculator";
pElement.textContent = "Perform basic arithmetic operations with this calculator.";

h1Element.style.textAlign = "center";
pElement.style.textAlign = "center";
let container = document.createElement("div");
container.appendChild(h1Element);
container.appendChild(pElement);



container.setAttribute("class","container");
document.body.append(container);
let calculator = document.createElement("div");
calculator.setAttribute("class","calculator");
container.append(calculator);



let output = document.createElement("input");
output.setAttribute("id", "result");
output.setAttribute("type", "text");
output.setAttribute("placeholder", "0");
calculator.appendChild(output);

/* ------------------------------------------------------------------------------ */

let clr = document.createElement("button");
clr.setAttribute("id","clear");
clr.addEventListener("click",Clr);
clr.innerText = "CL";
document.querySelector(".calculator").append(clr);
clr.addEventListener("click", Clr)
document.querySelector(".calculator").append(clr);
/* ------------------------------------------------------------------------------ */

let del = document.createElement("button");
del.addEventListener("click",Del);
del.innerText = "DEL";
document.querySelector(".calculator").append(del);
del.addEventListener("click", Del)
document.querySelector(".calculator").append(del);


/* ------------------------------------------------------------------------------ */

let percent = document.createElement("button");
percent.innerText = "%";
document.querySelector(".calculator").append(percent);
percent.addEventListener("click", function () {
display('%');})
