equal.innerText = "=";
equal.addEventListener("click", calc);
document.querySelector(".calculator").append(equal);

function display(num) {
  output.value += num;
}

function calc() {
  try {
      output.value = eval(output.value);
  } catch (err) {
      alert("Invalid Entry");
  }
}

function Clr() {
  output.value = "";
}

function Del() {
  output.value = output.value.slice(0, -1);
}
      

